import React from "react";
import Cookies from "js-cookie";
//import { HealmeLogo } from "../../../constants/constants";
//import { HomePagePic } from "../../../constants/constants";
import { useEffect } from "react";
import { useState } from "react"
import "./_doctor-settiming.css";



const Doc_setting:React.FC =()=>{
    var usr =Cookies.get("docname");
    
    const LogOut = ()=>{
        Cookies.set("docname","err");
        window.location.href = '/doctor_login';
    }
    useEffect(() => {
        //Runs on every render
        usr=Cookies.get("docname");
        if(usr==="err"){
            window.location.href = '/doctor_login';
        }
      });
      const [isActive, setIsActive] = useState(false);

    return(

        <div>
            vjnsjk njkvfnjk fn
            Set timing page for {usr}
            You are a doctor pola
            <div>
                <button className="LogoutButton" onClick={LogOut}>
                        Log Out
                </button>
            </div>
            <div>
            <body>
    <h2>Set Your Availability</h2>
    <table>
        <thead>
            <tr>
                <th>Time Slot</th>
                <th>Availability</th>
            </tr>
        </thead>
        <tbody>
            <tr>
                <td>9:00 AM - 10:00 AM</td>
                <td><button className="">Not Available</button></td>
            </tr>
            <tr>
                <td>10:00 AM - 11:00 AM</td>
                <td><button className="set-availability unset">Not Available</button></td>
            </tr>
            <tr>
                <td>11:00 AM - 12:00 PM</td>
                <td><button className="set-availability unset">Not Available</button></td>
            </tr>
        
        </tbody>
    </table>
    
    </body>
            </div>
        </div>
    )


}
export default Doc_setting;
